column5:
I feel the EXACT same way. I really only feel comfortable with my friend and boyfriend playing Overwatch and WoW. I literally just bought Minecraft last night to be able to go on servers and have fun with people and my anxiety won't even let me. I had to even stop playing classic WoW because it relies heavily on help from others but I just can't bring myself to do it.

&#x200B;

I think probably the best way to go about doing it is just to push yourself to get out there. If anyone is rude, oh well, you'll never see them in person and you'll most likely never play with them again! I need to take my own advice for sure, though lol.
